CREATE TABLE shipping_carriers (
  carrier_id INT PRIMARY KEY,
  carrier_name VARCHAR(50) NOT NULL
);

CREATE TABLE shipping_labels (
  label_id INT PRIMARY KEY,
  rate_id INT,
  label_data BYTEA NOT NULL,
  CONSTRAINT fk_shipping_labels_rate_id FOREIGN KEY (rate_id) REFERENCES shipping_rates(rate_id)
);

CREATE TABLE ShippingCarriers (
  carrier_id INT PRIMARY KEY,
  carrier_name TEXT NOT NULL,
  carrier_code TEXT NOT NULL
);

CREATE TABLE ShippingLocations (
  location_id INT PRIMARY KEY,
  location_name TEXT NOT NULL,
  location_address TEXT NOT NULL
);

CREATE TABLE ShippingRates (
  rate_id INT PRIMARY KEY,
  rate_value DECIMAL NOT NULL,
  carrier_id INT NOT NULL,
  FOREIGN KEY (carrier_id) REFERENCES ShippingCarriers(carrier_id)
);
